const contentful = require('contentful');
const client = contentful.createClient({
  space: '9ulwy6m5jpxs',
  accessToken: '2fsQuk07Wtt-7WkWKul0SjHwPBTQp4frPW70aqKFoGo',
});

function Blog() {
  console.log("blog"+Date.now());
  client.getEntries().then(entries => {
    entries.items.map(entry => {
      console.log(entry);
    });
  });
  // entries.map(entry => {
  //   console.log(entry);
  // })
  return (
    <div>
      <main className="container">
        Blog

      </main>
    </div>
  );
}

export default Blog;
